import React, { useEffect, useState } from 'react';
import axios from 'axios';


const ClientPage = () => {
    const [devices,setDevices] = useState([]);
    const [error,setError] = useState('');

    useEffect(() => {
        const fetchDevices = async () => {
            const userId = localStorage.getItem('userId'); // Obține ID-ul utilizatorului din localStorage
            try {
                // Asigură-te că URL-ul este corect și că ID-ul este trimis
                const response = await axios.get(`http://localhost:8083/api/user_device/${userId}/owned_devices`);
                setDevices(response.data); // Setează lista de dispozitive în stare
            } catch (err) {
                console.error(err);
                console.log(userId);
                setError('Failed to fetch devices');
            }
        };

        fetchDevices();
    }, []);

    return (
        <div>
            <h2>Client Dashboard</h2>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            <h3>Your Devices:</h3>
            <ul>
                {devices.map(device => (
                    <li key={device.id}>{device.name}</li> // Afișează numele fiecărui dispozitiv
                ))}
            </ul>
        </div>
    );
};

export default ClientPage;
